import React, { useState } from 'react';
import { startSession } from '../services/sessionService';
import './StartRide.css';

const StartRide = () => {
  const [rideDetails, setRideDetails] = useState({
    originAddress: '',
    originCity: '',
    originZip: '',
    destinationAddress: '',
    destinationCity: '',
    destinationZip: '',
    vehicleId: '',
    availableSeats: '',
    returnBack: false,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setRideDetails({ ...rideDetails, [name]: value });
  };

  const handleSubmit = async () => {
    try {
      await startSession(rideDetails);
      alert('Ride started successfully!');
    } catch (err) {
      alert('Error starting ride.');
    }
  };

  return (
    <div className="start-ride">
      <h3>Start a Ride</h3>
      <div className="form-group">
        <input
          type="text"
          name="originAddress"
          placeholder="Origin Address"
          value={rideDetails.originAddress}
          onChange={handleChange}
        />
        <input
          type="text"
          name="originCity"
          placeholder="Origin City"
          value={rideDetails.originCity}
          onChange={handleChange}
        />
        <input
          type="text"
          name="originZip"
          placeholder="Origin Zip"
          value={rideDetails.originZip}
          onChange={handleChange}
        />
        <input
          type="text"
          name="destinationAddress"
          placeholder="Destination Address"
          value={rideDetails.destinationAddress}
          onChange={handleChange}
        />
        <input
          type="text"
          name="destinationCity"
          placeholder="Destination City"
          value={rideDetails.destinationCity}
          onChange={handleChange}
        />
        <input
          type="text"
          name="destinationZip"
          placeholder="Destination Zip"
          value={rideDetails.destinationZip}
          onChange={handleChange}
        />
        <input
          type="text"
          name="vehicleId"
          placeholder="Vehicle ID"
          value={rideDetails.vehicleId}
          onChange={handleChange}
        />
        <input
          type="number"
          name="availableSeats"
          placeholder="Available Seats"
          value={rideDetails.availableSeats}
          onChange={handleChange}
        />
        <button onClick={handleSubmit}>Start Ride</button>
      </div>
    </div>
  );
};

export default StartRide;
